/* APP - JS */
import React, { Component } from 'react';
import { Link, Route, Routes } from 'react-router-dom';
import './App.css';
import '../src/components/Footer';

import Homepage from './components/Homepage';
import Upload from './components/Upload';
import Files from './components/Files';


export default function App () {

    return (
      <div className="App">
        <img src="https://img.icons8.com/nolan/64/video-playlist.png" alt="logo"/>
        <div className="titles">
          <h1>
            Player<br />Video
          </h1>
          <h2>
            To Upload. To compress. To view video files.
          </h2>
        </div>
        <footer className="footer">
              <p className="footer-contact-text">Presented by <span><a href="https://github.com/SYB-SFLA">Sophie BAYRAM</a></span></p>
        </footer>
        <Routes>
          <Route path="/" exact>
            <Homepage />
          </Route>
          <Route path="upload">
            <Upload />
          </Route>
          <Route path="files">
            <Files />
          </Route>
        </Routes>
        {/* <Footer /> */}
      </div>
    );
};
